import Navbar from './Navbar';
import Menu from './Menu';
import { Link } from 'react-router-dom';

const Login = () => {
	const handleSubmit = (e) => {
		e.preventDefault();
		console.log(e.target.name, '+++', e.target.value);
		e.target.name === 'submit' && console.log('...redirecting to database...');
	};
	return (
		<div>
			<Navbar />
			<div className="container ">
				<div className="row-cols-1">
					<div className="m-auto col-12 col-sm-10 col-md-8 col-lg-6 col-xl-6 col-xxl-6">
						<form>
							<div className="form-outline mb-4 mt-3">
								<input
									type="text"
									id="formNickname"
									className="form-control form-control-lg"
									placeholder="nickname"
									name="nickname"
									onChange={handleSubmit}
								/>
							</div>
							<div className="form-outline mb-4 mt-3">
								<input
									type="text"
									id="formPhone"
									className="form-control form-control-lg"
									placeholder="phone number"
									name="phone"
									onChange={handleSubmit}
								/>
							</div>

							<div className="form-outline mb-3">
								<input
									type="text"
									id="formPin"
									className="form-control form-control-lg"
									placeholder="4-digit pin"
									name="pin"
									onChange={handleSubmit}
								/>
								{/* {                    <label className="form-label" htmlFor="form3Example4">
                                Password
                            </label>} */}
							</div>
							<div className="col-auto mt-3 d-grid">
								<Link to="/">
									<button type="submit" className="btn btn-secondary" name="submit">
										Enter
									</button>
								</Link>
							</div>
						</form>
					</div>
				</div>
			</div>
			<Menu />{' '}
		</div>
	);
};

export default Login;
